    [],nt"revision_timestamp": "2016-07-27T23:03:11.103663",nt"name": "aleutian-canada-goose-nesting-survey-on-agattu-i-alaska-in-1990",nt"isopen":
    false,nt"url": null,nt"notes": "A survey for nests of Aleutian Canada geese
    (Branta canadensis leucopareia) was conducted at Agattu Island in June 1990. The
    coastal fringe on the eastern and southeastern portions of the island contained
    at least 53-56 nests, and we estimated that over 200 non-breeding geese may have
    been present. Most pairs began incubation during the last week of May and the peak
    of hatch occurred the last week of June. The average clutch contained 6 eggs, and
    at least 77 % of the eggs hatched. At least 1 egg hatched in nearly 95% of the nests,
    so overall productivity in 1990 was excellent.",nt"license_title": "License
